VALUES ('3237550029213', 'Choucroute garnie alsacienne', 'Choucroute cuisinée 52,5% : choucroute, jus de cuisson, graisse d\'oie (4%), Riesling (2%), sel, arôme, baies de genièvre, antioxydant : acide ascorbique. Knacks 13,8% : maigre et gras de porc, eau, maigre et gras de boeuf, plasma de porc, sel, épices (dont _moutarde_), stabilisants : diphosphates et polyphosphates, _lactose_, arômes naturels, dextrose, antioxydants : acide ascorbique, ascorbate de sodium, conservateur : nitrite de sodium. Boyau naturel de mouton. Saucisse fumée cuite 10% : maigre et gras de porc, eau, sel, dextrose, épices et plantes aromatiques, stabilisants : diphosphates et triphosphates, antioxydant : acide ascorbique, sucre, conservateur : nitrite de sodium, arômes naturels, poireau. Boyau naturel de porc. Pomme de terre 8,7% : pomme de terre, eau. Saucisson à l\'ail 7,5% : maigre et gras de porc, eau, blanc d\'_oeuf_, sel, épices (dont _moutarde_) et plante aromatique (ail déshydraté 0,4%), _lactose_, dextrose, stabilisants, diphosphates, triphosphates et polyphosphates, antioxydant : acide ascorbique, arômes naturels, conservateur : nitrite de sodium, colorants : carmins. Filet de porc cuit fumé 7,5% : filet de porc, eau, sel, dextrose, stabilisants : diphosphates et triphosphates, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium, arômes naturels.', 'https://static.openfoodfacts.org/images/products/323/755/002/9213/front.6.400.jpg', '11', '4', '3.1', '0.5', '1.6', '6.3', '1.3', '0.511811023622047', '', '0');

